import Container from '@mui/material/Container';
import { Box } from '@mui/material/Box';

const Home = () => {
    return (
        <main className="container">
            <div className="container">
                <Container maxWidth="lg">
                    <Box sx={{ bgcolor:'' }}></Box>
                </Container>
            </div>
        </main>
    );
}

export default Home;
